package com.aaludra.Switch;

public class SwitchExample2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		char c='B';
		switch(c) {
		case 'A':
			System.out.println("Vowel");
			break;
		case 'E':
			System.out.println("Vowel");
			break;
		case 'I':
			System.out.println("Vowel");
			break;
		case 'O':
			System.out.println("Vowel");
			break;
		case 'U':
			System.out.println("Vowel");
			break;
		default:
			System.out.println("Consonant");
		
		}

	}

}
